/** Returns a hash code value for this object.*/
@Override
public int hashCode() {
  int h = new Double(distance).hashCode();
  h ^= new Double(lat).hashCode();
  h ^= new Double(lng).hashCode();
  h ^= latField.hashCode();
  h ^= lngField.hashCode();
  return h;
}

